import React from 'react';

const DeviceDetails = ({ device }) => {
  return (
    <div>
      <h3>{device.name}</h3>
      <p>ID: {device.id}</p>
      <p>Name: {device.name}</p>
      <p>Model: {device.model}</p>
      <p>Status: {device.status}</p>
      {/* Render other device properties */}
    </div>
  );
};

export default DeviceDetails;
